import React, { useEffect } from "react";
import PanelTemplate from "./PanelTemplate";
import { useuseNavigate } from "react-router-dom";

function Account() {
    const navigate = useNavigate();
    const git = (page) => {
        navigate(`${page}`)
    }
    const [info, setInfo] = React.useState({});

    useEffect(() => {
        const ıd = localStorage.getItem("customer_id");

        fetch("http://localhost:5003/customer/info/${id}")
            .then(res => res.json())
            .then(data => {
                if (data.success) setInfo(data.info);
            });
    }, []);

    return (
        <PanelTemplate
            title="My Account"
            rightContent={
                <h2></h2>
            }
        />
    );
}

export default Account;
